import React, { useState } from 'react';

import './App.css';

function App() {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <div className="top">
      <header className={`closet ${menuOpen ? 'active' : ''}`}>
        <div className="container">
          <div className="brand">ร้านเสื้อผ้า</div>
          <nav className={menuOpen ? 'show' : ''}>
            <ul>
              <li><a href="#">หน้าแรก</a></li>
              <li><a href="#">สินค้า</a></li>
              <li><a href="#">ข่าวสาร</a></li>
              <li><a href="#">ติดต่อ</a></li>
              <li><a href="#"><FontAwesomeIcon icon={faSearch} /></a></li>
              <li><a href="#"><FontAwesomeIcon icon={faShoppingCart} /></a></li>
            </ul>
          </nav>
          <FontAwesomeIcon icon={faBars} className="fa-bars" onClick={toggleMenu} />
        </div>
      </header>
    </div>
  );
}

export default App;
